package main

func IsNested(s string) bool {
    balance := 0
    nested := false

    for _, char := range s {
        if char == '[' {
            balance++
            if balance > 1 {
                nested = true
            }
        } else if char == ']' {
            balance--
            if balance < 0 {
                return false
            }
        }
    }

    return nested && balance == 0
}

